import React, { useState, useEffect } from "react";
import { getOrderByOrderNo } from "../API/OrderDetailsApi";  // Import the API function

const ShowOrderDetails = ({ OrderNo }) => {
  const [orderDetails, setOrderDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch order details on component mount
  useEffect(() => {
    const fetchOrderDetails = async () => {
      try {
        const response = await getOrderByOrderNo(OrderNo);
        console.log(response);
        if (response.data) {
          setOrderDetails(response.data);  // Set the fetched data to state
        } else {
          setError("Order not found.");
        }
      } catch (err) {
        setError("Error fetching order details.");
        console.error("Error fetching order details:", err);
      } finally {
        setLoading(false);  // Set loading state to false after data is fetched
      }
    };

    if (OrderNo) {
      fetchOrderDetails();
    }
  }, [OrderNo]);  // Dependency array ensures this runs only when OrderNo changes

  // Show loading indicator while fetching
  if (loading) {
    return <p>Loading order details...</p>;
  }

  // Show error if fetching fails
  if (error) {
    return <p>{error}</p>;
  }
console.log(orderDetails);
  // Render order details if available
  return (
    <div>
      <h2>Order Details for OrderNo: {OrderNo}</h2>
      {orderDetails ? (
        <table>
          <thead>
            <tr>
              <th>Field</th>
              <th>Value</th>
            </tr>
          </thead>
          <tbody>
            {orderDetails.MatchingName && (
              <tr>
                <td>Matching Name</td>
                <td>{orderDetails.MatchingName}</td>
              </tr>
            )}
            {orderDetails.Freesize && (
              <tr>
                <td>Freesize</td>
                <td>{orderDetails.Freesize}</td>
              </tr>
            )}
            {orderDetails.XS && (
              <tr>
                <td>XS</td>
                <td>{orderDetails.XS}</td>
              </tr>
            )}
            {orderDetails.S && (
              <tr>
                <td>S</td>
                <td>{orderDetails.S}</td>
              </tr>
            )}
            {orderDetails.M && (
              <tr>
                <td>M</td>
                <td>{orderDetails.M}</td>
              </tr>
            )}
            {orderDetails.L && (
              <tr>
                <td>L</td>
                <td>{orderDetails.L}</td>
              </tr>
            )}
            {orderDetails.XL && (
              <tr>
                <td>XL</td>
                <td>{orderDetails.XL}</td>
              </tr>
            )}
            {orderDetails["2XL"] && (
              <tr>
                <td>2XL</td>
                <td>{orderDetails["2XL"]}</td>
              </tr>
            )}
            {orderDetails["3XL"] && (
              <tr>
                <td>3XL</td>
                <td>{orderDetails["3XL"]}</td>
              </tr>
            )}
            {orderDetails["4XL"] && (
              <tr>
                <td>4XL</td>
                <td>{orderDetails["4XL"]}</td>
              </tr>
            )}
            {orderDetails["5XL"] && (
              <tr>
                <td>5XL</td>
                <td>{orderDetails["5XL"]}</td>
              </tr>
            )}
            {orderDetails.Total && (
              <tr>
                <td>Total</td>
                <td>{orderDetails.Total}</td>
              </tr>
            )}
            {orderDetails.UserId && (
              <tr>
                <td>UserId</td>
                <td>{orderDetails.UserId}</td>
              </tr>
            )}
          </tbody>
        </table>
      ) : (
        <p>No order details found.</p>
      )}
    </div>
  );
};

export default ShowOrderDetails;
